// src/components/Sidebar.js
import React from "react";
import "./Sidebar.css";

const Sidebar = () => {
  return (
    <div className="sidebar">
      <h1 className="sidebar-logo">Trinar</h1>
      <ul className="sidebar-links">
        <li>Home Page</li>
        <li>Notifications</li>
        <li>Messages</li>
        <li>Profile</li>
        <li>Settings</li>
        <li>Privacy</li>
      </ul>
    </div>
  );
};

export default Sidebar;
